document.getElementById('download-dropdown-pdf').addEventListener('click', function () {
    const { jsPDF } = window.jspdf;

    // Get input values (Ensure all fields are available and valid)
    const name = document.getElementById('client-name').value || "N/A";

    // Makkah hotel details
    const meccaHotelName = document.getElementById('mecca-hotel').value || "N/A";
    const meccaHotelRating = document.getElementById('mecca-rating').value || "N/A";
    const meccaHotelDistance = document.getElementById('mecca-distance').value || "N/A";
    const meccaNights = document.getElementById('mecca-nights').value || "0";
    const meccaRooms = document.getElementById('number-rooms-makkah').value || "1";

    // Madinah hotel details
    const madinahHotelName = document.getElementById('madinah-hotel').value || "N/A";
    const madinahHotelRating = document.getElementById('madinah-rating').value || "N/A";
    const madinahHotelDistance = document.getElementById('madinah-distance').value || "N/A";
    const madinahNights = document.getElementById('madinah-nights').value || "0";
    const madinahRooms = document.getElementById('number-rooms-madinah').value || "1";

    // Other inputs
    const numberOfAdults = document.getElementById('number-adults').value || "0";
    const numberOfChildren = document.getElementById('number-children').value || "0";
    const checkInDate = document.getElementById('check-in-date').value || "N/A";
    const checkOutDate = document.getElementById('check-out-date').value || "N/A";
    const airlineName = document.getElementById('airline-name').value || "N/A";

    // Get calculated values for total cost, adult rate, child rate
    const totalCostPKR = document.getElementById('total-cost-pkr') ?
        document.getElementById('total-cost-pkr').textContent.split(': ')[1] : "0";
    const singleAdultRatePKR = document.getElementById('single-adult-rate-pkr') ?
        document.getElementById('single-adult-rate-pkr').textContent.split(': ')[1] : "0";
    const singleChildRatePKR = document.getElementById('single-child-rate-pkr') ?
        document.getElementById('single-child-rate-pkr').textContent.split(': ')[1] : "0";

    // Format the check-in and check-out dates
    const formatDate = (dateString) => {
        const date = new Date(dateString);
        const options = { day: '2-digit', month: '2-digit', year: 'numeric' };
        return date.toLocaleDateString('en-GB', options); // 'en-GB' format is day-month-year
    };

    const formattedCheckInDate = formatDate(checkInDate);
    const formattedCheckOutDate = formatDate(checkOutDate);

    // Base64 Logo (Replace this with a valid base64 string)
    const logoBase64 = 'data:image/png;base64,'; 

    // Create the HTML structure for the PDF content
    const element = document.createElement('div');
    element.innerHTML = `
        <div style="display: flex; justify-content: space-between; align-items: center;">
            <div>
                <h2 style="margin: 0; font-weight: bold; font-size: 20px;">Dar-ul-Falah International Travel & Tours (Pvt.) Ltd.</h2>
                <p style="margin: 0;">Race Course Road, Patiala House, Lahore, Pakistan.</p>
                <p style="margin: 0; font-weight: bold;">Ph: +92-323-7775858 / +92-323-9998881</p>
            </div>
            <div>
                <img src="${logoBase64}" width="100" style="border-radius: 10px;">
            </div>
        </div>
        
        <h1 style="text-align: center; font-size: 24px; font-weight: bold;">Calculated Umrah Package</h1>
        <hr style="border: 1px solid #ccc; margin: 20px 0;">

        <h3 style="text-align: center; font-size: 16px;">Name: <span style="font-weight: normal;">${name}</span></h3>
        <h3 style="text-align: center; font-size: 16px;">Check-in Date: <span style="font-weight: normal;">${formattedCheckInDate}</span></h3>
        <h3 style="text-align: center; font-size: 16px;">Check-out Date: <span style="font-weight: normal;">${formattedCheckOutDate}</span></h3>
        <h3 style="text-align: center; font-size: 16px;">Airline: <span style="font-weight: normal;">${airlineName}</span></h3>

        <hr style="border: 1px solid #ccc; margin: 20px 0;">
        <h1 style="text-align: center; font-size: 23px; font-weight: bold;">Hotels</h1>

        <div style="display: flex; justify-content: center; margin-bottom: 10px;">
            <div style="width: 48%; border: 1px solid #ccc; padding: 10px; box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.1); margin-right: 10px;">
                <h3 style="text-align: center; font-size: 17px;">Makkah Hotel</h3>
                <p style="text-align: center; font-size: 17px; font-weight: 400;">${meccaHotelName}</p>
                <p style="text-align: center; font-size: 15px;">Rating: ${meccaHotelRating}, Distance: ${meccaHotelDistance}</p>
                <p style="text-align: center; font-size: 15px;">Number of Rooms: ${meccaRooms}</p>
                <p style="text-align: center; font-size: 15px;">Nights: ${meccaNights}</p>
            </div>

            <div style="width: 48%; border: 1px solid #ccc; padding: 10px; box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.1);">
                <h3 style="text-align: center; font-size: 17px;">Madinah Hotel</h3>
                <p style="text-align: center; font-size: 17px; font-weight: 400;">${madinahHotelName}</p>
                <p style="text-align: center; font-size: 15px;">Rating: ${madinahHotelRating}, Distance: ${madinahHotelDistance}</p>
                <p style="text-align: center; font-size: 15px;">Number of Rooms: ${madinahRooms}</p>
                <p style="text-align: center; font-size: 15px;">Nights: ${madinahNights}</p>
            </div>
        </div>

        <hr style="border: 1px solid #ccc; margin: 20px 0;">
        <h1 style="text-align: center; font-size: 23px; font-weight: bold;">Package Rates</h1>

        <div style="display: flex; justify-content: center; margin-bottom: 10px;">
            <div style="width: 48%; border: 1px solid #ccc; padding: 10px; box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.1); margin-right: 10px;">
                <h3 style="text-align: center; font-size: 17px;">Number of Adults: ${numberOfAdults}</h3>
                <p style="text-align: center; font-size: 17px;">Single Adult Rate: PKR ${singleAdultRatePKR}</p>
            </div>

            ${numberOfChildren > 0 ? `
                <div style="width: 48%; border: 1px solid #ccc; padding: 10px; box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.1);">
                    <h3 style="text-align: center; font-size: 17px;">Number of Children: ${numberOfChildren}</h3>
                    <p style="text-align: center; font-size: 17px;">Single Child Rate: PKR ${singleChildRatePKR}</p>
                </div>
            ` : ''}
        </div>

        <div style="border: 1px solid #ccc; padding: 10px; box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.1); margin-top: 20px; text-align: center;">
            <h3 style="font-size: 18px;">Total Cost: <span style="font-weight: bold;">PKR ${totalCostPKR}</span></h3>
        </div>

        <h2 style="text-align: center; font-size: 14px; color: #555;">"If you need have further queries contact us and feel free to visit our office. Thank You!"</h2>
    `;

    // Create a new jsPDF instance
    const doc = new jsPDF();

    // Add content to the PDF
    doc.html(element, {
        callback: function (doc) {
            // Save the PDF with a name
            doc.save(`${name}_Umrah_Package.pdf`);
        },
        x: 10,
        y: 10,
        width: 190, // max width of content
        windowWidth: 650, // window width for PDF
    });
});
